import React, { useState, useEffect } from 'react';
import { queueAPI } from '../utils/api';

const AdminDashboard = () => {
  const [currentQueue, setCurrentQueue] = useState(null);
  const [todayStats, setTodayStats] = useState({
    total: 0,
    waiting: 0,
    inService: 0,
    completed: 0
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
    // Refresh data every 30 seconds
    const interval = setInterval(fetchDashboardData, 30000);
    return () => clearInterval(interval);
  }, []);

  const fetchDashboardData = async () => {
    try {
      const response = await queueAPI.getCurrentQueue();
      setCurrentQueue(response.data.data);

      // Calculate stats from waiting queues
      const stats = {
        total: response.data.data.waitingQueues.length + (response.data.data.currentQueue ? 1 : 0),
        waiting: response.data.data.waitingQueues.length,
        inService: response.data.data.currentQueue ? 1 : 0,
        completed: 0 // Would need additional endpoint for this
      };
      setTodayStats(stats);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const StatCard = ({ title, value, icon, color, subtext }) => (
    <div className={`bg-white rounded-xl shadow-sm border border-gray-100 p-6 hover:shadow-md transition-shadow duration-200`}>
      <div className="flex items-center justify-between">
        <div>
          <p className="text-gray-600 text-sm font-medium">{title}</p>
          <p className={`text-3xl font-bold ${color} mt-1`}>{value}</p>
          {subtext && <p className="text-gray-500 text-xs mt-1">{subtext}</p>}
        </div>
        <div className={`w-12 h-12 rounded-xl flex items-center justify-center text-2xl ${color === 'text-blue-600' ? 'bg-blue-100' : color === 'text-green-600' ? 'bg-green-100' : color === 'text-yellow-600' ? 'bg-yellow-100' : 'bg-purple-100'}`}>
          {icon}
        </div>
      </div>
    </div>
  );

  const QueueCard = ({ queue, isCurrentlyServed = false }) => (
    <div className={`p-4 rounded-xl border-2 transition-all duration-200 ${
      isCurrentlyServed 
        ? 'border-green-200 bg-green-50' 
        : 'border-gray-200 bg-white hover:border-blue-200'
    }`}>
      <div className="flex items-center justify-between">
        <div className="flex items-center space-x-3">
          <div className={`w-10 h-10 rounded-full flex items-center justify-center font-bold text-white ${
            isCurrentlyServed ? 'bg-green-500' : 'bg-blue-500'
          }`}>
            {queue.queueNumber}
          </div>
          <div>
            <p className="font-semibold text-gray-800">{queue.patient?.fullName || 'Nama tidak tersedia'}</p>
            <p className="text-sm text-gray-600">{queue.appointmentTime}</p>
          </div>
        </div>
        <div className="text-right">
          <span className={`px-3 py-1 rounded-full text-xs font-medium ${
            isCurrentlyServed 
              ? 'bg-green-100 text-green-700' 
              : 'bg-blue-100 text-blue-700'
          }`}>
            {isCurrentlyServed ? 'üîÑ Sedang Dilayani' : '‚è≥ Menunggu'}
          </span>
        </div>
      </div>
    </div>
  );

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-96">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto"></div>
          <p className="text-gray-600 mt-4">Memuat dashboard...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-white/70 backdrop-blur-md rounded-2xl shadow-xl border border-white/20 p-6">
        <div className="flex items-center justify-between">
          <div>
            <h1 className="text-3xl font-bold bg-gradient-to-r from-blue-600 to-indigo-600 bg-clip-text text-transparent">
              üè† Dashboard Admin
            </h1>
            <p className="text-gray-600 mt-2">Kelola antrian dan pantau aktivitas praktik</p>
          </div>
          <div className="text-right">
            <p className="text-sm text-gray-500">Hari ini</p>
            <p className="text-lg font-semibold text-gray-800">
              {new Date().toLocaleDateString('id-ID', { 
                weekday: 'long', 
                year: 'numeric', 
                month: 'long', 
                day: 'numeric' 
              })}
            </p>
          </div>
        </div>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <StatCard
          title="Total Antrian Hari Ini"
          value={todayStats.total}
          icon="üìã"
          color="text-blue-600"
          subtext="Semua antrian"
        />
        <StatCard
          title="Sedang Menunggu"
          value={todayStats.waiting}
          icon="‚è≥"
          color="text-yellow-600"
          subtext="Dalam antrian"
        />
        <StatCard
          title="Sedang Dilayani"
          value={todayStats.inService}
          icon="üîÑ"
          color="text-green-600"
          subtext="Pasien aktif"
        />
        <StatCard
          title="Selesai Hari Ini"
          value={todayStats.completed}
          icon="‚úÖ"
          color="text-purple-600"
          subtext="Pasien selesai"
        />
      </div>

      {/* Current Queue & Waiting List */}
      <div className="grid lg:grid-cols-3 gap-6">
        {/* Current Queue */}
        <div className="lg:col-span-2">
          <div className="bg-white rounded-xl shadow-sm border border-gray-100 p-6">
            <div className="flex items-center justify-between mb-6">
              <h2 className="text-xl font-semibold text-gray-800">üîÑ Antrian Aktif</h2>
              <button className="px-4 py-2 bg-blue-100 text-blue-700 rounded-lg text-sm font-medium hover:bg-blue-200 transition-colors duration-200">
                Refresh
              </button>
            </div>

            {currentQueue?.currentQueue ? (
              <QueueCard queue={currentQueue.currentQueue} isCurrentlyServed={true} />
            ) : (
              <div className="text-center py-12">
                <div className="w-16 h-16 bg-gray-100 rounded-full flex items-center justify-center mx-auto mb-4">
                  <span className="text-2xl">üò¥</span>
                </div>
                <p className="text-gray-600 font-medium">Tidak ada pasien yang sedang dilayani</p>
                <p className="text-gray-500 text-sm mt-1">Panggil antrian berikutnya untuk memulai</p>
              </div>
            )}

            {/* Quick Actions */}
            <div className="mt-6 flex space-x-3">
              <button className="flex-1 py-3 bg-green-100 text-green-700 rounded-lg font-medium hover:bg-green-200 transition-colors duration-200">
                ‚ñ∂Ô∏è Panggil Berikutnya
              </button>
              <button className="flex-1 py-3 bg-blue-100 text-blue-700 rounded-lg font-medium hover:bg-blue-200 transition-colors duration-200">
                ‚úÖ Selesaikan
              </button>
              <button className="px-6 py-3 bg-gray-100 text-gray-700 rounded-lg font-medium hover:bg-gray-200 transition-colors duration-200">
                ‚è∏Ô∏è Jeda
              </button>
            </div>
          </div>
        </div>

        {/* Waiting List */}
        <div>
          <div className="bg-white rounded-xl shadow-sm border border-gray-100 p-6">
            <h2 className="text-xl font-semibold text-gray-800 mb-6">‚è≥ Daftar Tunggu</h2>

            {currentQueue?.waitingQueues?.length > 0 ? (
              <div className="space-y-3 max-h-96 overflow-y-auto">
                {currentQueue.waitingQueues.slice(0, 10).map((queue) => (
                  <QueueCard key={queue.id} queue={queue} />
                ))}
                {currentQueue.waitingQueues.length > 10 && (
                  <div className="text-center py-3">
                    <p className="text-gray-500 text-sm">
                      +{currentQueue.waitingQueues.length - 10} antrian lainnya
                    </p>
                  </div>
                )}
              </div>
            ) : (
              <div className="text-center py-8">
                <div className="w-12 h-12 bg-gray-100 rounded-full flex items-center justify-center mx-auto mb-3">
                  <span className="text-xl">üìù</span>
                </div>
                <p className="text-gray-600 font-medium">Tidak ada antrian</p>
                <p className="text-gray-500 text-sm mt-1">Semua pasien sudah dilayani</p>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* Recent Activity */}
      <div className="bg-white rounded-xl shadow-sm border border-gray-100 p-6">
        <h2 className="text-xl font-semibold text-gray-800 mb-6">üìä Aktivitas Terbaru</h2>

        <div className="space-y-4">
          <div className="flex items-center space-x-4 p-3 bg-green-50 rounded-lg">
            <div className="w-8 h-8 bg-green-100 rounded-full flex items-center justify-center">
              <span className="text-green-600 text-sm">‚úÖ</span>
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-gray-800">Pasien #15 telah selesai dilayani</p>
              <p className="text-xs text-gray-500">2 menit yang lalu</p>
            </div>
          </div>

          <div className="flex items-center space-x-4 p-3 bg-blue-50 rounded-lg">
            <div className="w-8 h-8 bg-blue-100 rounded-full flex items-center justify-center">
              <span className="text-blue-600 text-sm">‚ûï</span>
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-gray-800">Antrian baru ditambahkan untuk hari ini</p>
              <p className="text-xs text-gray-500">5 menit yang lalu</p>
            </div>
          </div>

          <div className="flex items-center space-x-4 p-3 bg-yellow-50 rounded-lg">
            <div className="w-8 h-8 bg-yellow-100 rounded-full flex items-center justify-center">
              <span className="text-yellow-600 text-sm">‚ö†Ô∏è</span>
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-gray-800">Pasien #12 membatalkan antrian</p>
              <p className="text-xs text-gray-500">10 menit yang lalu</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
